import React from "react";
import { useState } from "react";
import { BrowserRouter,Routes,Route } from "react-router-dom";
import { Nav } from "./Nav";
import { Error } from "./Error";
import { Register } from "./Register";
import { Signin } from "./Signin";
import { Registeradmin } from "./Add";
import { Deleteadmin } from "./Delete";
import { Logout } from "./Signout";
import { Addproducts } from "./Addproduct";
import { Deleteproducts } from "./Deleteproduct";
import { Card } from "./Card";
import { Sta } from "./Sta";
import { Gro } from "./Gro";
import { Elec } from "./Elec";
import { Fast } from "./Fast";
function Routing()
{
    let [search,setsearch] = useState("");
    return(
        <>
            <BrowserRouter>
            <Nav setmsg = {(msg)=>{
                setsearch(msg);
                alert(search);
            }}></Nav>
                <Routes>
                    <Route path="/register" element={<Register></Register>}></Route>
                    <Route path="/login" element={<Signin></Signin>}></Route>
                    <Route path="add/admin" element={<Registeradmin></Registeradmin>}></Route>
                    <Route path="delete/admin" element={<Deleteadmin></Deleteadmin>}></Route>
                    <Route path="/logout"></Route>
                    <Route path="add/product" element={<Addproducts></Addproducts>}></Route>
                    <Route path="delete/product" element={<Deleteproducts></Deleteproducts>}></Route>
                    <Route path="/home" element={<Card></Card>}></Route>
                    <Route path="categories/:name" element={<Sta></Sta>} ></Route>
                    <Route path="*" element={<Error></Error>}></Route>
                </Routes>
            </BrowserRouter>
        </>
    )
}

export {Routing};
